import React from 'react'; 
import classes from './HeaderLeft.module.css';
import companyLogo from './img/logoBlueWhite.PNG'
import {Link} from 'react-router-dom';
import {BiDotsVertical} from 'react-icons/bi';



function HeaderLeft(props){





//console.log('Inside Header Left: ',props.preferredCourse[0].subject);



return (

 <div className={classes.headerLeft} > 

      <img className={classes.logo} src={companyLogo} alt='edr Logo' />

      <button className={classes.ExpConButton} onClick={props.onPress}> <BiDotsVertical className={classes.ExpConIcon} /></button>	

      <button className={classes.courseNameButton} > 
 	<i> <b>{ props.preferredCourse.length>0 &&  props.preferredCourse[0].subject} </b></i>
	<i>{ props.preferredCourse.length===0 &&  <span>No Course Selected</span>}</i>
	{ props.preferredCourse.length>0 && <sup className={classes.superScript}>@B.Sc.</sup> }
      </button>	

  </div>

);


}

export default HeaderLeft;
